import classesMain from "./Main.module.css";
import classesAbout from "./About.module.css";

const About = () => {
  return (
    <>
      <div className={classesAbout.aboutContainer}>
        <h1 className={classesMain.subTitle}>ABOUT</h1>
      </div>
    </>
  );
};

export default About;
